import React from "react";
import './sub-component css/Colab_works.css'
function Colab_works() {
    return(
        <>
            <div className="colab-content1">
                <div className="colab-image">

                </div>
                <div className="colab-title">
                    <h1>School Management System</h1>
                    <p>Outside of coding, I enjoy playing lead guitar, combining  my technical 
                    and creative skills in both Outside of coding, I enjoy playing lead 
                    guitar, combining my technical and creative skills in both</p>
                </div>
            </div>
        </>
    );
}
export default Colab_works;
